  return (
    <div className="quiz">
      <Header navigateTo={navigateTo} />
      <div className="quiz-content">
        <h2>Quiz Page</h2>
        <p>This is where you can provide information about the quiz.</p>
        <p>Write your quiz content here...</p>
      </div>
    </div>
  );
};

export default Quiz;
